import React from 'react';
import  {createRoot} from 'react-dom/client';
import { Route, Router } from 'react-router-dom';
import App from './App';

export const root = createRoot(document.getElementById('root'));
root.render(
  <Router>
    <Route path='/' component={App} />
  </Router>,
);
